import React from 'react'
import Navbar from './components/Navbar'
import Textform from './components/Textform'

function App(){
  return(
    <>
    <Navbar title='textutils' abouttext='about us'/>
    <div></div>
    <Textform heading='enter text to analyze'/>
    </>
  )

}
export default App
